Команда Wachanga - международный стартап, мы создали экосистему мобильных приложений для семьи и родителей, сейчас это уже почти 2 миллиона активных пользователей по всему миру. Среди приложений Wachanga: женский календарь, календарь беременности, ассистент по грудному кормлению и уходу за младенцем и др.

Мы ищем iOS разработчика, для участия в развитии приложений в рамках продуктовой команды при поддержке разработчиков из core-команды. Продукт, над которым предстоит работать – Календарь беременности. Он является самым популярным трекером беременности в российских сторах, но команда ориентируется, прежде всего, на иностранные рынки (EU, US, LATAM, Asia).

Мы ждем от тебя:
• Знание Swift;
• Владение Git;
• Понимание что такое и зачем нужны ООП, SOLID, алгоритмы, структуры данных, паттерны программирования и архитектура;
• Опыт работы с iOS SDK
• Знание AutoLayout.

Твоим преимуществом будет:
• Знание реактивного программирования;
• Понимание MVVM архитектуры;
• Опыт работы с Realm, ReactiveSwift, CocoaPods, Carthage.

Условия:
• Гибкий график;
• Удаленная работа;
• Официальное трудоустройство по ТК РФ;
• Заработная плата дважды в месяц и точно в срок.

Если тебе интересно наше предложение, то укажи в сопроводительном письме ссылку на Git с проектами (если есть), а также короткий ответ на вопросы: Что интересно в iOS и почему ты хочешь в нашу команду?

This a Full Remote job, the offer is available from: Cyprus

О компании и проекте:

Компания ищет талантливого Flutter Developer для присоединения к динамичной финтех команде исследований и разработок (R&D), занимающейся брокерской деятельностью и предоставляющей своим клиентам передовые финансовые продукты. Команда компании сосредоточена на разработке инновационных решений в области финансовых инструментов, играя ключевую роль в создании новых продуктов и интеграции новейших технологий и инструментов в процесс разработки ПО.

Инфраструктура компании обеспечивает стабильную работу нашей торговой платформы, используя различные системы и сервисы на базе Linux, такие как DNS, Gitlab, Artifactory и Vault. С более чем 700 сотрудниками и партнерами в семи офисах по всему миру (включая Великобританию, Гибралтар, ОАЭ, Багамы, Австралию и головной офис на Кипре), компания активно расширяет своё международное присутствие.

Присоединяйтесь к нам, чтобы вместе формировать будущее финтеха!

Обязанности:
• Участие в проектировании и архитектуре приложений;
• Разработка высококачественных кроссплатформенных приложений с использованием Flutter;
• Автоматизация процессов тестирования приложений;
• Оптимизация производительности приложений;
• Изучение и интеграция новых технологий и инструментов для улучшения рабочих процессов разработки;
• Тесное сотрудничество с дизайнерами, разработчиками, тестировщиками и членами команды для достижения целей проекта.

Requirements

Требования:
• Опыт разработки кроссплатформенных приложений на Flutter и отличное владение Dart
• Знание принципов UI и кроссплатформенного дизайна
• Знакомство с WebSocket и RESTful API
• Готовность осваивать новые технологии и профессионально расти
• Умение работать в команде и эффективно взаимодействовать с коллегами
• Русский язык на уровне B2+, английский на уровне B2+

Будет плюсом:
• Опыт работы с нативными SDK для Android или iOS;
• Владение Java, Kotlin, Swift или Objective-C;
• Знание систем контроля версий, таких как Git;
• Понимание основных концепций адаптивного и реактивного программирования.

Benefits

Компания предлагает:
• Гибкий формат удаленной работы;
• Возможности для обучения и профессионального роста;
• Увлекательная корпоративная культура: воркшопы, лекции и яркие мероприятия (в настоящее время онлайн);
• Медицинская страховка для сотрудников, проживающих на Кипре;
• Поддерживающая и позитивная рабочая атмосфера.

